import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import 'bootstrap/dist/css/bootstrap.min.css';

import React from 'react';
import { toBeRequired } from '@testing-library/jest-dom/dist/matchers';

function App() {  
  return (  
    <Navbar bg="light" expand="md">  
    <Container>  
      <Navbar.Brand  href="#home"><img src={require('./logo.jpg')} alt='logo'/></Navbar.Brand>  
      <Navbar.Toggle aria-controls="basic-navbar-nav" />  
      <Navbar.Collapse id="basic-navbar-nav">  
        <Nav className="me-auto">  
          <Nav.Link style={{color:"darkgreen"}} style={{padding:30}} href="#home">Home</Nav.Link>  
          <Nav.Link style={{color:"darkgreen"}} style={{padding:30}} href="#link">Link</Nav.Link>  
          <NavDropdown style={{color:"darkgreen"}} style={{padding:30}} style={{pa}} title="Dropdown" id="basic-nav-dropdown">  
            <NavDropdown.Item href="#action/3.1">Dropdown Item 1</NavDropdown.Item>  
            <NavDropdown.Item href="#action/3.2">Dropdown Item 2</NavDropdown.Item>  
            <NavDropdown.Item href="#action/3.3">Dropdown Item 3</NavDropdown.Item>  
            <NavDropdown.Divider />  
            <NavDropdown.Item href="#action/3.4">Another Item</NavDropdown.Item>  
          </NavDropdown>  
        </Nav>  
      </Navbar.Collapse>  
    </Container>  
  </Navbar>  
  );  
}  
export default App;
